import React from 'react'
import Yoga from '../Untitled-1.jpg'
function Book() {
  return (
    <div>
       <h1 style={{color}}>My First Project On Photoshop</h1>
       <img src={Yoga} width={'320px'} alt=''/>
    </div>
  )
}

export default Book
